import React from 'react'
import TeamMember from './TeamMember'

function Team() {
    return(
        <div className='row'>
        <TeamMember 
        pi = {{
            img: 'khaled1.jpg',
            name: 'Nour Homsi',
            position: 'Graphic Designer',
            phone: '046 025 1465',
            website: 'www.esedu.fi',
         }} 
         />
        <TeamMember 
        pi = {{
            img: 'khaled2.jpg',
            name:'Khaled Alkilani',
            position: 'Junior Software Developer',
            // phone: '045 207 8489',
            website: 'www.esedu.fi',
             }}
        />
        <TeamMember 
        pi = {{
            img: 'khaled1.jpg',
            name: 'Captin Majed',
            position: 'IT Engineer',
            phone: '044 550 8467'
         }}
        />
        </div>
    )
}

export default Team
